import logo from '../../logo.svg';
import '../../App.css';
import { Button } from '@material-ui/core';
const DopComponentn = ({umnog,countn,  delenie}) => {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          {/* <p>
            {helloText}
          </p>
          <a
            className="App-link"
  
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a> */}
          
         {/*  <div className="but">
            <Button variant="outlined" color="primary" onClick = {incrementClick}>PLUS </Button>
            <Button variant="outlined" color="primary" onClick = {incrementClickTwo}>Minus</Button>
          </div>
          <div className="but1">
            {count}
          </div> */}
          
         <div className="but">
            <Button variant="outlined" color="primary" onClick = {umnog}> * </Button>
            <Button variant="outlined" color="primary" onClick = {delenie}>/</Button>
          </div>
          <div className="but1">
            {countn}
          </div> 
  
        </header>
      <div>
      
  </div>
  </div>
    );
  }
  export default DopComponentn;
